def authorize(request):
    
    if request.session.get('is_login', None):
        advancedperson_list=TempPerson2.objects.filter().order_by('id')
        person_list=Person.objects.filter().order_by('id')
        
        tempname=request.session['user_name']
        nick=Administrator.objects.get(UserName=tempname).NickName

        master_list=Authorize.objects.filter().order_by('id')
        
        context={'person_list':person_list,'nick':nick,'advancedperson_list':advancedperson_list,'master_list':master_list,}
        if request.method == 'POST':            
            message = "授权成功！"                       
            orders=request.POST.getlist('idd')
            if orders:
                length=len(orders)
                masters = request.POST['username']
                same_name_user = Advanced_Person.objects.filter(UserName=masters)
                if same_name_user:
                    for i in range(0,length):
                        ids = orders[i]
                        tempname=Person.objects.get(id=ids).UserName
                        same_name_user2 = Authorize.objects.filter(Master=masters,PersonName=tempname)
                        if same_name_user2:
                            message="有重复的数据"
                        else:    
                            temp_record=Authorize()
                            temp_record.Master=masters
                            temp_record.PersonName=tempname
                            temp_record.save()                              
                    context={'person_list':person_list,'nick':nick,'advancedperson_list':advancedperson_list,'master_list':master_list,'message':message,}
                    return render(request, 'db_xyw/authorize.html', context)
                else:
                    message="不存在输入的高级用户！"
                    context={'person_list':person_list,'nick':nick,'advancedperson_list':advancedperson_list,'master_list':master_list,'message':message,}
                    return render(request, 'db_xyw/authorize.html', context)                                              
            else:
                message="请选择普通用户！"
                context={'person_list':person_list,'nick':nick,'advancedperson_list':advancedperson_list,'master_list':master_list,'message':message,}
                return render(request, 'db_xyw/authorize.html', context)
        return render(request,'db_xyw/authorize.html',context)
    else:
        return redirect('/db_xyw/login')

