def login(request):
    if request.method == "POST":
        login_form=UserForm(request.POST)
        message="请检查填写的内容！"
        if login_form.is_valid():
            username = login_form.cleaned_data['UserName']
            password = login_form.cleaned_data['keyNumber']
            #return redirect('/db_xyw/detail')
            try:
                user = Person.objects.get(UserName=username)
                if user.keyNumber == password:
                    request.session['is_login'] = True
                    request.session['user_id'] = user.id
                    request.session['user_name'] = user.UserName
                    return redirect('/db_xyw/detail')
                else:
                    message = "密码不正确！"
            except:
                message = "用户不存在！"
        return render(request, 'db_xyw/login.html',locals())

    login_form=UserForm()    
    return render(request,'db_xyw/login.html',locals())

def register(request):
    if request.session.get('is_login', None):
        # 登录状态不允许注册。你可以修改这条原则！
        return redirect("/db_xyw/detail")
    if request.method == "POST":
        register_form = RegisterForm(request.POST)
        #login_form=UserForm(request.POST)
        message = "请确认已阅读用户须知！"
        if register_form.is_valid():  # 获取数据
            username = register_form.cleaned_data['UserName']
            password1 = register_form.cleaned_data['keyNumber1']
            password2 = register_form.cleaned_data['keyNumber2']
            nickname = register_form.cleaned_data['NickName']
            sex = register_form.cleaned_data['sex']
            age = register_form.cleaned_data['age']
            height = register_form.cleaned_data['height']
            weight = register_form.cleaned_data['weight']
            if password1 != password2:  # 判断两次密码是否相同
                message = "两次输入的密码不同！"
                return render(request, 'db_xyw/register.html', locals())
            same_name_user = Person.objects.filter(UserName=username)
            if same_name_user:  # 用户名唯一
                message = '用户已经存在，请重新选择用户名！'
                return render(request, 'db_xyw/register.html', locals())
            if age<1 or age>100:
                message = '年龄超出限制'
                return render(request, 'db_xyw/register.html', locals())
            if height<100 or height>220:
                message = '身高超出限制'
                return render(request, 'db_xyw/register.html', locals())
            if weight<10 or weight>200:
                message = '体重超出限制'
                return render(request, 'db_xyw/register.html', locals())
                # 当一切都OK的情况下，创建新用户

            new_user = Person()
            new_user.UserName = username
            new_user.keyNumber = password1
            new_user.NickName = nickname
            new_user.sex = sex
            new_user.age = age
            new_user.height = height
            new_user.weight = weight
            new_user.localtime=timezone.now()
            new_user.save()
            return redirect('/db_xyw/login')  # 自动跳转到登录页面
    register_form = RegisterForm()
    return render(request, 'db_xyw/register.html', locals())

